import React from 'react';
import './App.css';
import Header from "./components/Header";
import Navigator from "./components/Navigator";
import ContentRouter from "./router/ContentRouter";

function App() {
  return (
    <div className="app">
      <Header/>
      <div className="content">
        <Navigator/>
        <ContentRouter/>
      </div>
    </div>
  );
}

export default App;
